import React from "react";
import axios from "axios";
import { Link } from "react-router-dom";

export default class Login extends React.Component{
    render(){
        return(
            <form className="mt-5">
              <label>
                <p>Username</p>
                <input type="text" />
              </label>
              <label>
                <p>Password</p>
                <input type="password" />
              </label>
              <div>
                <button className="btn btn-light" type="submit">Submit</button>
              </div>
            </form>
          )
    }

}
